(13, '1612606865.png', 'Psychiatry', 'Psychiatry is the medical specialty devoted to the diagnosis, prevention, and treatment of mental disorders.', '2021-02-06 04:21:05', '2021-02-06 04:21:05'),
(14, '1612607043.png', 'Psychotherapy', 'Psychotherapy is a general term for treating mental health problems by talking with a psychiatrist, psychologist or other mental health providers.', '2021-02-06 04:24:03', '2021-02-06 04:24:03'),
(15, '1612607333.png', 'General Surgery', 'General surgery is a surgical specialty that focuses on abdominal contents including the esophagus, stomach, small intestine.', '2021-02-06 04:28:53', '2021-02-06 04:28:53'),
(16, '1612607470.png', 'Orthopedic Surgery (Knee Shoulder)', 'Orthopedic surgery or orthopedics, also spelled orthopaedics, is the branch of surgery concerned', '2021-02-06 04:31:10', '2021-02-06 04:31:10'),
(17, '1612607660.png', 'Spine surgery', 'Spinal laminectomy/spinal decompression. This is performed when spinal stenosis causes a narrowing of the spinal canal that results in pain, numbness or weakness', '2021-02-06 04:34:20', '2021-02-06 04:34:20'),
(18, '1612608287.jpg', 'Oncology', 'Oncology is a branch of medicine that deals with the prevention, diagnosis, and treatment of cancer.', '2021-02-06 04:44:47', '2021-02-06 04:44:47'),
(19, '1612608397.jpg', 'Urology', 'Urology, also known as genitourinary surgery, is the branch of medicine that focuses on surgical and medical diseases of the male and female urinary-tract system', '2021-02-06 04:46:37', '2021-02-06 04:46:37'),
(20, '1612608534.jpg', 'Gynaecology', 'Gynaecology or gynecology is the medical practice dealing with the health of the female reproductive system.', '2021-02-06 04:48:54', '2021-02-06 04:48:54'),
(21, '1612608793.png', 'Obstetrics', 'Obstetrics is the field of study concentrated on pregnancy, childbirth and the postpartum period.', '2021-02-06 04:53:13', '2021-02-06 04:53:13'),
(22, '1612609118.jpg', 'Skin,Allergy & VD', 'An allergy is an immune system response to a foreign substance that\'s not typically harmful to your body. These foreign substances are called allergens.', '2021-02-06 04:58:38', '2021-02-06 04:58:38'),
(23, '1612609391.png', 'Otorhinolaryngology', 'Otorhinolaryngology is a surgical subspecialty within medicine that deals with the surgical and medical management of conditions of the head and neck.', '2021-02-06 05:03:11', '2021-02-06 05:03:11'),
(24, '1612609631.png', 'Hormone', 'A hormone is any member of a class of signaling molecules in multicellular organisms, that are transported to distant organs to regulate physiology', '2021-02-06 05:07:11', '2021-02-06 05:07:11'),
(25, '1612610171.png', 'Neonatal and Pediatrics', 'Pediatrics is the branch of medicine that involves the medical care of infants, children, and adolescents.', '2021-02-06 05:16:11', '2021-02-06 05:16:11'),
(26, '1612610333.jpg', 'Pediatric Surgery', 'Pediatric surgery is a subspecialty of surgery involving the surgery of fetuses, infants, children, adolescents, and young adults', '2021-02-06 05:18:53', '2021-02-06 05:18:53'),
(27, '1612610565.jpg', 'Pediatric & Pulmonology', 'Pediatric Pulmonology is a monthly peer-reviewed medical journal covering pediatric pulmonology.', '2021-02-06 05:22:45', '2021-02-06 05:22:45'),
(28, '1612610686.png', 'Nephrology', 'Nephrology is a specialty of medicine and pediatric medicine that concerns with study of the kidneys, specifically normal kidney function and kidney disease.', '2021-02-06 05:24:46', '2021-02-06 05:24:46'),
(29, '1612611180.jpg', 'Pediatric Neurology', 'The Paediatric Neurology service provide management of acute and chronic Neurological and developmental disorders in children.', '2021-02-06 05:33:00', '2021-02-06 05:33:00'),
(30, '1612611347.png', 'Ophthalmology', 'Ophthalmology is a branch of medicine and surgery which deals with the diagnosis and treatment of eye disorders', '2021-02-06 05:35:47', '2021-02-06 05:35:47'),
(31, '1612612629.jpg', 'Hematology', 'Hematology is the branch of medicine concerned with the study of the cause, prognosis, treatment, and prevention of diseases related to blood.', '2021-02-06 05:57:09', '2021-02-06 05:57:09'),
(32, '1612612823.png', 'Anesthesiologist & Pain', 'Anesthesiology, anaesthesiology, anaesthesia or anaesthetics is the medical specialty concerned with the total perioperative care of patients before, during and after surgery.', '2021-02-06 06:00:23', '2021-02-06 06:00:23'),
(33, '1612613035.jpg', 'Physical Medicine', 'Physical medicine and rehabilitation, also known as physiatry, is a branch of medicine that aims to enhance and restore functional ability and quality of life to people', '2021-02-06 06:03:55', '2021-02-06 06:03:55'),
(34, '1612613159.jpg', 'Rheumatology & Medicine', 'Rheumatology is a branch of medicine devoted to the diagnosis and therapy of rheumatic diseases.', '2021-02-06 06:05:59', '2021-02-06 06:05:59'),
(35, '1612613321.png', 'Neurology & Medicine', 'Neurology is the branch of medicine concerned with the study and treatment of disorders of the nervous system.', '2021-02-06 06:08:41', '2021-02-06 06:08:41'),
(36, '1612613488.png', 'Orthopedic surgery (Hip & Knee)', 'Orthopedic surgery or orthopedics, also spelled orthopaedics, is the branch of surgery concerned with conditions involving the musculoskeletal system', '2021-02-06 06:11:28', '2021-02-06 06:11:28'),
(37, '1612613648.png', 'Orthopedic Surgery (Spine)', 'An orthopaedic spine surgeon is an orthopaedist who further specializes in the diagnosis and treatment of spinal diseases and conditions', '2021-02-06 06:14:08', '2021-02-06 06:14:08'),
(38, '1612613749.jpg', 'Gastroenterology &   Medicine', 'Diseases affecting the gastrointestinal tract, which include the organs from mouth into anus, along the alimentary canal, are the focus of this speciality.', '2021-02-06 06:15:49', '2021-02-06 06:15:49'),
(39, '1612613931.png', 'Liver & Medicine', 'The liver is an organ only found in vertebrates which detoxifies various metabolites, synthesizes proteins and produces biochemicals necessary for digestion and growth', '2021-02-06 06:18:51', '2021-02-06 06:18:51'),
(40, '1612614085.png', 'Colorectal surgery', 'Colorectal surgery is a field in medicine dealing with disorders of the rectum, anus, and colon.', '2021-02-06 06:21:25', '2021-02-06 06:21:25'),
(41, '1612614292.png', 'THORASIC SURGERY', 'Thoracic surgery refers to operations on organs in the chest, including the heart, lungs and esophagus.', '2021-02-06 06:24:52', '2021-02-06 06:24:52'),
(42, '1612614430.jpg', 'Cardiac Surgery', 'Cardiac surgery, or cardiovascular surgery, is surgery on the heart or great vessels performed by cardiac surgeons', '2021-02-06 06:27:10', '2021-02-06 06:27:10'),
(43, '1612614706.jpg', 'Cardiology & Medicine', 'Cardiology is a medical specialty and a branch of internal medicine concerned with disorders of the heart.', '2021-02-06 06:31:46', '2021-02-06 06:31:46'),
(44, '1612614946.png', 'Cardiothoracic & Vascular Surgery', 'Cardiothoracic surgery is the field of medicine involved in surgical treatment of organs inside the thoracic cavity —conditions of the heart, lungs, and other pleural.', '2021-02-06 06:35:46', '2021-02-06 06:35:46'),
(45, '1612615048.png', 'Cardiothoracic Anaesthesia', 'Cardiothoracic anesthesiology is a subspeciality of the medical practice of anesthesiology, devoted to the preoperative, intraoperative.', '2021-02-06 06:37:28', '2021-02-06 06:37:28'),
(46, '1612615315.png', 'Child Psychologist', 'Child psychology is the study of subconscious and conscious childhood development.', '2021-02-06 06:41:55', '2021-02-06 06:41:55'),
(47, '1612615517.jpg', 'Dental & Maxillofacial Surgery', 'Maxillofacial surgery is a surgical specialty focusing on reconstructive surgery of the face, facial trauma surgery.', '2021-02-06 06:45:17', '2021-02-06 06:45:17'),
(48, '1612615613.jpg', 'Orthodontics & Dentofacial Orthopedics', 'Orthodontics is a specialty of dentistry that deals with the diagnosis, prevention, and correction of malpositioned teeth and jaws, and misaligned bite patterns.', '2021-02-06 06:46:54', '2021-02-06 06:46:54'),
(49, '1612615838.png', 'Dermatology', 'Dermatology is the branch of medicine dealing with the skin. It is a speciality with both medical and surgical aspects.', '2021-02-06 06:50:38', '2021-02-06 06:50:38'),
(50, '1612615954.png', 'Venereology', 'Venereology is a branch of medicine that is concerned with the study and treatment of sexually transmitted diseases.', '2021-02-06 06:52:34', '2021-02-06 06:52:34'),
(51, '1612616061.jpg', 'Gastroenterology', 'Diseases affecting the gastrointestinal tract, which include the organs from mouth into anus, along the alimentary canal, are the focus of this speciality.', '2021-02-06 06:54:21', '2021-02-06 06:54:21'),
(52, '1612616240.png', 'Hepatology', 'Hepatology is the branch of medicine that incorporates the study of liver, gallbladder, biliary tree, and pancreas as well as management of their disorders.', '2021-02-06 06:57:20', '2021-02-06 06:57:20'),
(53, '1612616600.png', 'Otolaryngology', 'Otorhinolaryngology is a surgical subspecialty within medicine that deals with the surgical and medical management of conditions of the head and neck.', '2021-02-06 07:03:20', '2021-02-06 07:03:20'),
(54, '1612617003.jpg', 'Lap Surgery', 'Laparoscopy is an operation performed in the abdomen or pelvis using small incisions with the aid of a camera.', '2021-02-06 07:10:03', '2021-02-06 07:10:03'),
(55, '1612617518.jpg', 'Neonatal ICU', 'A neonatal intensive care unit, also known as an intensive care nursery, is an intensive care unit specializing in the care of ill or premature newborn infants', '2021-02-06 07:18:38', '2021-02-06 07:18:38'),
(56, '1612617794.jpg', 'Anesthesiology', 'Anesthesiology, anaesthesiology, anaesthesia or anaesthetics is the medical specialty concerned with the total perioperative care of patients before, during and after surgery.', '2021-02-06 07:23:14', '2021-02-06 07:23:14'),
(57, '1612617941.jpg', 'Radiotherapy', 'Radiation therapy or radiotherapy, often abbreviated RT, RTx, or XRT, is a therapy using ionizing radiation, generally as part of cancer treatment to control', '2021-02-06 07:25:41', '2021-02-06 07:25:41'),
(58, '1612618128.jpg', 'Surgical Oncology', 'Surgical oncology is the branch of surgery applied to oncology; it focuses on the surgical management of tumors, especially cancerous tumors.', '2021-02-06 07:28:48', '2021-02-06 07:28:48'),
(59, '1612618340.png', 'Plastic Surgery', 'Plastic surgery is a surgical specialty involving the restoration, reconstruction, or alteration of the human body.', '2021-02-06 07:32:20', '2021-02-06 07:32:20'),
(60, '1612618509.jpg', 'Clinical Psychology', 'Clinical psychology is an integration of science, theory, and clinical knowledge for the purpose of understanding, preventing.', '2021-02-06 07:35:09', '2021-02-06 07:35:09'),
(61, '1612618695.png', 'Anaesthesiology', 'Anesthesiology, anaesthesiology, anaesthesia or anaesthetics is the medical specialty concerned with the total perioperative care of patients before, during and after surgery.', '2021-02-06 07:38:15', '2021-02-06 07:38:15'),
(62, '1612618822.png', 'Neurosurgery', 'Neurosurgery, or neurological surgery, is the medical specialty concerned with the prevention, diagnosis, surgical treatment, and rehabilitation', '2021-02-06 07:40:22', '2021-02-06 07:40:22'),
(63, '1612618919.png', 'Nuclear Medicine', 'Nuclear medicine is a medical specialty involving the application of radioactive substances in the diagnosis and treatment of disease.', '2021-02-06 07:41:59', '2021-02-06 07:41:59'),
(64, '1612619101.png', 'Obstetrics', 'Obstetrics is the field of study concentrated on pregnancy, childbirth and the postpartum period', '2021-02-06 07:45:01', '2021-02-06 07:45:01'),
(65, '1612619432.png', 'Paediatric Surgery & Paediatric Urology', 'Pediatric surgery is a subspecialty of surgery involving the surgery of fetuses, infants, children, adolescents, and young adults.', '2021-02-06 07:50:32', '2021-02-06 07:50:32'),
(66, '1612619578.png', 'Paediatrics & Neonatology', 'Pediatrics is the branch of medicine that involves the medical care of infants, children, and adolescents.', '2021-02-06 07:52:58', '2021-02-06 07:52:58'),
(67, '1612619677.png', 'Physical Medicine & Rehabilitation', 'Physical medicine and rehabilitation, also known as physiatry, is a branch of medicine that aims to enhance and restore functional ability', '2021-02-06 07:54:37', '2021-02-06 07:54:37'),
(68, '1612619970.png', 'Plastic, Reconstructive & Cosmetic Surgery', 'Reconstructive surgery is a term with training, clinical, and reimbursement implications. It has historically been referred to as synonymous with plastic surgery.', '2021-02-06 07:59:30', '2021-02-06 07:59:30'),
(69, '1612620324.png', 'Burn & Plastic Surgery', 'Reconstructive burn surgery is a surgical procedure that may be needed when initial burn wounds have healed.', '2021-02-06 08:05:24', '2021-02-06 08:05:24'),
(70, '1612620525.jpg', 'Dermatologist', 'Dermatology is the branch of medicine dealing with the skin. ... A dermatologist is a specialist doctor who manages diseases related to skin, hair, nails, and some cosmetic problems.', '2021-02-06 08:08:45', '2021-02-06 08:08:45'),
(71, '1612620669.png', 'Kidney', 'The kidneys are a pair of bean-shaped organs on either side of your spine, below your ribs and behind your belly.', '2021-02-06 08:11:09', '2021-02-06 08:11:09'),
(72, '1612620913.png', 'Thyroid and Hormone', 'The thyroid gland uses iodine from food to make two thyroid hormones: triiodothyronine (T3) and thyroxine (T4). It also stores these thyroid hormones and releases them as they are needed.', '2021-02-06 08:15:13', '2021-02-06 08:15:13'),
(73, '1612621018.jpg', 'Diabetology & Endocrinology', 'Diabetology is the clinical science of diabetes mellitus, its diagnosis, treatment and follow-up. It can be considered a specialised field of endocrinology', '2021-02-06 08:16:58', '2021-02-06 08:16:58'),
(74, '1612621171.png', 'Gynecology & Obstetrics', 'Gynaecology or gynecology is the medical practice dealing with the health of the female reproductive system. Outside medicine, the term means \"the science of women\".', '2021-02-06 08:19:31', '2021-02-06 08:19:31'),
(75, '1612621306.png', 'Andrology', 'Andrology is the medical specialty that deals with male health, particularly relating to the problems of the male reproductive system', '2021-02-06 08:21:46', '2021-02-06 08:21:46'),
