(2, 'Ibn Sina Diagnostic Center, Uttara', '+88055555665', 'ibn@gmail.com', 'House # 52, Sector # 13, Uttara, Dhaka – 1230', '8287451612680911.jpg', 'Prof. Dr. Sabbir Ahmed Khan is a Urologist & Surgeon doctor in Dhaka. His qualification is MBBS, FCPS (Surgery), MS (Urology). He is working as a Urologist & Surgeon doctor in Uttara Adhunik Medical College & Hospital. He regularly provides treatment to his patients at Ibn Sina Diagnostic Center, Uttara. Practicing hour of Prof. Dr. Sabbir Ahmed Khan at Ibn Sina Diagnostic Center, Uttara is 5.30pm to 8pm (Tuesday & Friday).', NULL, '2021-02-07 00:55:11', '2021-02-07 00:55:11'),
(4, 'Medical College for Women & Hospital (MCW&H)', '58950003', 'medicalcollegeforwomen@yahoo.com', 'Plot-4, Road-8/9, Sector-1\r\nUttara Model Town, Dhaka-1230, Bangladesh', '4208221612681579.png', 'ggg', NULL, '2021-02-07 01:06:19', '2021-02-07 01:06:19'),
(6, 'Bangladesh Specialized Hospital', '09666-700100', 'advice@bshl.com.bd', '21 Shyamoli, Mirpur Road, Dhaka-1207, Bangladesh', '4104341649600369.png', 'BSH has all the characteristics of a world-class hospital with wide range of services and specialists, equipments and technology, ambience and service quality. The hospital is a showcase of synergy of medical technology and advances in ICT Division through paperless medical records. The skilled nurses, technologists and administrators of Bangladesh Specialized Hospital, aided by state-of-the-art equipments, provide a congenial infrastructure for the medical professionals in providing healthcare of international standards.', NULL, '2022-04-10 14:19:29', '2022-04-10 14:19:29'),
(7, 'Dhaka Central International Medical College & Hospital (DCIMCH)', '01770008844', 'info@dcimch.com', '2/1 Ring Road, Shyamoli,Dhaka - 1207, Bangladesh', '1107651649668824.png', '\"The Dhaka Central International Medical College and Hospital is one of the leading medical college providing education and health care services of truly global standards. A comprehensive range of general and super specialty medical services are provided here.\r\nThe college focuses to deliver high quality, comprehensive, integrated medical education including innovative thoughts towards modern technology and research. We provide the finest in infrastructure and facilities to our students when it comes to learning and research along with experienced and dedicated faculty, outstanding clinical facilities, and a world-class environment that supports education. We offer different courses including medicine, dentistry, nursing, allied sciences and many more.\r\nThe College comprising of well-trained personnel provides focused health care services. We are successfully accomplishing our mission of serving the society with our widespread infrastructure, state-of-the-art equipment, backed by the nation’s best professionals, equals those available globally.\r\nDCIMCH provides a 24-hour, seven-day-a-week services. Departments like emergency department, critical care unit, blood bank, central diagnostic Lab and ambulance services works round the clock to implement the growing requirements of patients.\r\nDCIMCH serves over thousands of patients annually. As a leading educational and health care organization DCIMCH develops and maintains a spirit of charity and cooperation with the primary goal of improving patient safety and of promoting health in rural and underserved communities. DCIMCH wish to rise above the realm of therapeutic care with a new focus on preventive care, to bring health to the community.\"', NULL, '2022-04-11 09:20:24', '2022-04-11 09:20:24'),
(8, 'Dhaka Central International Medical College & Hospital (DCIMCH)', '01770008844', 'info@dcimch.com', '2/1 Ring Road, Shyamoli,Dhaka - 1207, Bangladesh', '2437221649669009.png', '\"The Dhaka Central International Medical College and Hospital is one of the leading medical college providing education and health care services of truly global standards. A comprehensive range of general and super specialty medical services are provided here.\r\nThe college focuses to deliver high quality, comprehensive, integrated medical education including innovative thoughts towards modern technology and research. We provide the finest in infrastructure and facilities to our students when it comes to learning and research along with experienced and dedicated faculty, outstanding clinical facilities, and a world-class environment that supports education. We offer different courses including medicine, dentistry, nursing, allied sciences and many more.\r\nThe College comprising of well-trained personnel provides focused health care services. We are successfully accomplishing our mission of serving the society with our widespread infrastructure, state-of-the-art equipment, backed by the nation’s best professionals, equals those available globally.\r\nDCIMCH provides a 24-hour, seven-day-a-week services. Departments like the emergency department, critical care unit, blood bank, central diagnostic Lab and ambulance services works round the clock to implement the growing requirements of patients.\r\nDCIMCH serves over thousands of patients annually. As a leading educational and health care organization DCIMCH develops and maintains a spirit of charity and cooperation with the primary goal of improving patient safety and of promoting health in rural and underserved communities. DCIMCH wish to rise above the realm of therapeutic care with a new focus on preventive care, to bring health to the community.\"', NULL, '2022-04-11 09:23:29', '2022-04-11 09:23:29'),
(9, 'Bangladesh Shishu Hospital and Institute', '880-2-55059051-61', 'info@dsh.org.bd', 'Sher-e-Bangla Nagar, Dhaka-1207, Bangladesh.', '9050931649669211.jpg', '\"Dhaka Shishu (Children) Hospital is the largest children hospital in Bangladesh. It is a Government supported tertiary level public hospital for children with 640 beds.\r\nA few months after the liberation of Bangladesh, in March 1972, Dhaka Shishu (Children) hospital, the only children hospital in the country was established. With the help of a few voluntary organizations and the Government of Bangladesh, it first started its services in a private house at Dhanmondi, Dhaka with 50 indoor beds. The out patient department (OPD) of the hospital started in a tent in the nearby area of Sukrabad, Dhaka at the same time. Consistent financial support was received initially from the “Save the Children Fund. UK” and later on from the “World Vision, Bangladesh”.\r\n\r\nDecember 1974 National Economic Council (NEC) of Bangladesh chaired by the Father of the Nation Bangabandhu Sheikh Mujibur Rahman, the then Prime Minister of the People’s Republic of Bangladesh, approved a scheme to construct a 250-bed children hospital expandable to 650 beds. Subsequently, in March 1975, with the approval of the Ministry of Health and Family Welfare of Bangladesh, the site of the project was transferred to the present location at Sher-e-Barigla Nagar, Shyamoli, Dhaka.\r\n\r\nDhaka Shishu Hospital started functioning this premise from June 1977. The construction costs were funded by the government-grants and DSH trust-fund which was gathered from donations, two public lotteries and concerts. A committee formed by the Ministry of Health and Family Welfare, Bangladesh supervised the construction project. Among others, Late Prof. Tofayel Ahmed, the Founder Member Secretary of the Management Board of Dhaka Shishu Hospital, was a member of the construction committee.\r\n\r\nIn 17th January 2012 Honorable Prime Minister Sheikh Hasina laid the foundation stone of a new 9-storied building of the Hospital. At the same time she also inaugurated the Paediatric Cardiac Center with Cardiac Surgery, Cath-lab, & Cardiac ICU facilities which is the first office kind for children in the country.\r\n\r\nBANGLADESH INSTITUTE OF CHILD HEALTH (BICH)\r\nBICH, the academic wing of Dhaka Shish Hospital was established in 1983 to conduct various paediatric postgraduate courses such as FCPS, MD, MS, DCH along with Deploma in Paediatric Nursing and Bsc Health Technology etc. The institute is affiliated with the University of Dhaka, Bangabandhu Sheikh Mujib Medical University(BSMMU) and the Bangladesh Collage of Physicians and Surgeons (BCPS). The Institute has academic and research link with Institute of Child Health, London, UK, Institute of Child Health, Edinburgh, UK, John Hopkins University, Baltimore, US\r\n\r\nDEPARTMENTS\r\nDhaka Shishu Hospital comprises five major divisions e.g. Paediatric Medicine, Paediatric Surgey& Anaesthesia and the Diagnostic Division. Paediatric Medicine consists of Cardiology, Nephrology, Neurology, Child Development & Child Pschycology, Neonatology, Gastroenterology, Hepatology and Nutrition, Haematology-oncology & Thalassemia, Respiratory Medicine, Endocrinology & Metabolic Disorder, Infectious Diseases and Community Paediatrics, General Paediatrics. Paediatric Surgery includes Neonatal Surgery, Urology, Burn & Reconstuctive Surgery, Paediatric Orthopaedics,& Traumatology, Surgical Oncology, Laparoscopy and ENT Surgery. Diagnostic division includes Microbiology, Clinical Pathology, Biochemistry, Radiology & Imaging.\r\n\r\nThe intensive Care Unit (ICU) for children, the first of its kind in Bangladesh was established in this hospital in 1992. It has Day Care Centre, Observation & Referral Unit & a well equipped Physiotherpy Department.\r\n\r\nThe OPD and the Emergency handle a 900-1000 of paediatric patients daily. The OPD includes Medicine, Surgery, ENT, Skin, Dentistry, EPI, CDC, Breast feeding counseling and various follow up clinics. Follow up clinics include Cardiology, Nephrology, Child Development Centre, Neonatology, Growth and Nutrition, TB and Endocrinology. The hospital has two special centres such as Thalassaemia Centre and CDC where patients are receiving specialized treatment. Five beds have been reserved in the Infectious Disease and Community Paediatrics Unit for emergency outbreak e.g. Diarrhoea, Dengue Fever and Swine Flu.\r\n\r\nSince taking over charge the present management board decided to improve the quality of different services for which responsibilities for cleaning, pest control and security services have been strengthened. Centralized oxygen supply, computerized accounting system and automated patients admission system, centralized announcing system, audiovisual health education programme for attendants and parents at the OPD, audiovisual orientation for nursing staff have been introduced to improve existing services.\"', NULL, '2022-04-11 09:26:51', '2022-04-11 09:26:51'),
(10, 'National Institute of Kidney Diseases & Urology', '02-9135690-4', 'info@nikdu.org.bd', 'Sher-e Bangla Nagar,Dhaka - 1207, Bangladesh', '4326761649669353.png', 'The need for establishment of National Institute of Kidney Diseases & Urology (NIKDU) ws felt considering the situation of indequate treatment facilities avainable for patients with kidney nd urological diseases, dialysis and transplantation. Then project is financed be Govt. of Peoples Republic of bangladesh.', NULL, '2022-04-11 09:29:13', '2022-04-11 09:29:13'),
(11, 'BDM Hospital', '02-9134555', 'info@bdmhospital.songzog.com', '02-9134555', '2726171649670133.png', 'Welcome to the Bdm Hospital. Specialist: EyeGastroenterologyGynaecologyMedicineObstetricPediatricSurgery Facilities: AnesthesiaE. C. G.News paper & TV in waiting roomOperation theatreOwn diagnostic LabOxygen supplyPharmacyPost operative bedUltra sonogramWaiting roomX ray More..', NULL, '2022-04-11 09:42:13', '2022-04-11 09:42:13'),
(12, 'IBN SINA Medical College Hospital, Kallyanpur', '01311-799593, 01844-141173, 01703-725590', 'ismchoffice@gmail.com', '1/1, Mirpur Road, Kallyanpur, Dhaka-1216', '834111649670615.png', '\"The Ibn Sina Trust started its journey in June 1980 with a noble vision “To serve the humanity”. The trust has agreed upon to provide healthcare service to the people of Bangladesh at affordable cost. At the early of its commencement, few dedicated social workers of Bangladesh came together and had been united with a strong determination to serve people of the country, the compatriots. That ambition was materialized in the form of “Ibn Sina Trust”.\r\n\r\nAt the time of launching, the trust was an institute of 13 employees including Physicians, Technical and Administrative staffs. Over the period of time, by the grace of almighty Allah Subhanahu Wa Tala, the Ibn Sina Trust is now a name of ‘TRUST’ in the sector of health care in Bangladesh and is one of the largest health service provider in South Asia.\r\n\r\nThe trust is now serving the people of Bangladesh by providing health facilities through a reputed Medical College, a renowned Nursing Institute, a specialized hospital with 300 beds along with other two general hospitals consist of 300 and 50 beds. Besides, the Ibn Sina Trust is more famous in the sector of diagnosis and investigation. It is an ISO certified organization and has one of the equipped laboratories of the country.\r\n\r\nThe laboratory and imaging reports of Ibn Sina Diagnostic centers are well accepted in Singapore General Hospital, Mount Elizabeth Hospital Singapore, Bumrungrad International Hospital Thailand and other reputed hospitals of Asia. It has been possible because of using latest analyzer and imaging machineries of medical science in Ibn Sina Diagnostic Centers. Well educated and the most experienced reporting consultants are working hard here to verify the reports.\r\n\r\nIt is our pride to mention that our consultants have authority on their respective area of expertise with European and North American degrees. Ibn Sina Trust is enthusiastic to introduce the latest inventions of medical science of Germany, Europe and North America. Our laboratory has 3 Tesla with Biometric MRI, 128 slice CT scan machine and other latest imaging and laboratory machineries. It won’t be excess to mention that we have introduced these machines well ahead of other countries of South Asia. World famous Siemens-Germany, General Electronic-USA, Olympus Japan, Kiazon Japan, Nihonkoden Japan, and Fuji Japan are our proud suppliers.\"', NULL, '2022-04-11 09:50:15', '2022-04-11 09:50:15'),
(13, 'Ibn Sina Diagnostic & Imaging Center, Dhanmondi', '09610-010615', 'info@ibnsinatrust.com', 'House 48, Road 9/A, Dhanmondi, Dhaka-1209', '3455331649670873.png', 'The Ibn Sina Trust started its journey in June 1980 with a noble vision “To serve the humanity”. The trust has agreed upon to provide healthcare service to the people of Bangladesh at affordable cost. At the early of its commencement, few dedicated social workers of Bangladesh came together and had been united with a strong determination to serve people of the country, the compatriots. That ambition was materialized in the form of “Ibn Sina Trust”.\r\n\r\nAt the time of launching, the trust was an institute of 13 employees including Physicians, Technical and Administrative staffs. Over the period of time, by the grace of almighty Allah Subhanahu Wa Tala, the Ibn Sina Trust is now a name of ‘TRUST’ in the sector of health care in Bangladesh and is one of the largest health service provider in South Asia.\r\n\r\nThe trust is now serving the people of Bangladesh by providing health facilities through a reputed Medical College, a renowned Nursing Institute, a specialized hospital with 300 beds along with other two general hospitals consist of 300 and 50 beds. Besides, the Ibn Sina Trust is more famous in the sector of diagnosis and investigation. It is an ISO certified organization and has one of the equipped laboratories of the country.\r\n\r\nThe laboratory and imaging reports of Ibn Sina Diagnostic centers are well accepted in Singapore General Hospital, Mount Elizabeth Hospital Singapore, Bumrungrad International Hospital Thailand and other reputed hospitals of Asia. It has been possible because of using latest analyzer and imaging machineries of medical science in Ibn Sina Diagnostic Centers. Well educated and the most experienced reporting consultants are working hard here to verify the reports.\r\n\r\nIt is our pride to mention that our consultants have authority on their respective area of expertise with European and North American degrees. Ibn Sina Trust is enthusiastic to introduce the latest inventions of medical science of Germany, Europe and North America. Our laboratory has 3 Tesla with Biometric MRI, 128 slice CT scan machine and other latest imaging and laboratory machineries. It won’t be excess to mention that we have introduced these machines well ahead of other countries of South Asia. World famous Siemens-Germany, General Electronic-USA, Olympus Japan, Kiazon Japan, Nihonkoden Japan, and Fuji Japan are our proud suppliers.', NULL, '2022-04-11 09:54:33', '2022-04-11 09:54:33'),
(14, 'Ibn Sina Specialized Hospital, Dhanmondi', '01824-666536', 'info@ibnsinatrust.com', 'House#68, Road#15/A, Dhanmondi, Dhaka-1209', '9582501649671040.png', 'The Ibn Sina Hospital was established in July 1983, Keeping in Pace with continuous development of medical technologies,Ibn Sina hospital has been rendering its services in the field of Medicine (Internal, Neuro, Nephro, Gastro-liver, Cardiac, Onco, Endocrine etc.), Surgery, Gynae, Neuro surgery, Spine Surgery, Knee Surgery, colorectal Surgery, Orthopedics Surgery, urology etc. It provides tertiary level of medical care in those fields. Besides it has opened a new horizon in Laparoscopic Abdominal and colorectal Surgery. With affordable cost it gives services to the ever increasing number of kidney patients through its dialysis unit equipped with most modern equipment and backed by a dedicated medical team.\r\n\r\nIbn SinaHospital is proud of its ICU unit for rendering round the clock intensive care services with the help of most modern and sophisticated equipments supported by a very dedicated, skilled, and efficient team of doctors, nurses and other staffs. Ibn Sina Hospital has 8 well equipped operation theater where C-Arm, Operating Microscope available to make operation more effective.', NULL, '2022-04-11 09:57:20', '2022-04-11 09:57:20'),
(15, 'Ibn Sina Medical Imaging Center, Zigatola', 'imiczist@gmail.com', 'imiczist@gmail.com', 'House#58, Road#2/A, Dhaka-1209', '5631111649671139.png', '\"It is equipped with the latest and technologically advanced appliances. A number of leading specialized consultants attend here regularly, and it is renowned countrywide for its unparalleled round-the-clock service and utmost dedication. Fully computerized Hormone and Immunology analyzers, Biochemistry and Hematology auto-analyzer, Serology auto analyzer, Coagulation analyzer, Histopathology, Cytology, Micro biology, PCR Lab,Video endoscope, Digital E.E.G, Blood culture (Fan Method), Electrophoresis of Hb & protein. Digital X-ray, OPG, Mammography, 4D USG, Broncoscopy, Colposcopy, Echo, Color Doppler, ETT, ECG, Holter Monitor,Duplex study,NCV/EMG,FNAC, Uroflowmetry,Spirometry,128 slice CT Scan, 1.5T & 18 channel double unit MRI 1st time in Bangladesh.\r\n\r\nIt also offers a well equipped modern Breast Care Center, physiotherapy,Corporate Health Check up service, Consultation service etc.\"', NULL, '2022-04-11 09:58:59', '2022-04-11 09:58:59'),
(16, 'Ibn Sina Diagnostic & Consultation Center, Badda', '09610-009614', 'info@ibnsinamedicalbd.com', 'Cha-72/1, Progoti Soroni, Uttar Badda, Dhaka-1212', '4015531649671689.png', '\"We the IBN SINA MEDICAL CHECK-UP UNIT an approved Medical Check-Up Center of the Executive Board of The Health Minister’s Council for G.C.C (Gulf Co-operation Council) States, bearing G.C.C Computer Code No. 05/01/11. We are situated at the prime location of Dhaka city located at Cha # 72/1, Pragati Sharoni, North Badda, Dhaka-1212, BANGLADESH.\r\nWe are fully equipped with modern Medical Check-up facilities and technologies are as per requirements of G.C.C (Gulf Co-operation Council) for performing of Medical check-up of the passengers for G.C.C. countries.\"', NULL, '2022-04-11 10:08:09', '2022-04-11 10:08:09'),
(17, 'Ibn Sina Diagnostic Center Lalbagh Ltd.', '01784-382464', 'ibnsinalalbagh@gmail.com', '27/4 Dhakeshwari Road, Lalbagh, Dhaka-1211', '5778041649672196.png', '\"Ibn Sina diagnostic and Consultation center, Malibagh started its services from 10.07.2017 by a formal discussion and prayer occasion chaired by Professor Dr A K M Sadrul Islam, Honorable member administration of Ibn Sina Trust. It’s a well equipped diagnostic Laboratory with the latest and technologically advanced appliances.\r\nA number of leading specialized consultants attend here regularly, and it is renowned countrywide for its unparalleled round-the-clock service and utmost dedication. Fully computerized Hormone and Immunology analyzers, Biochemistry and Hematology auto-analyzer, Serology auto analyzer, Coagulation analyzer, Histo pathology, Cytology, Micro biology, Video endoscope, Digital E.E.G, Blood culture (Fan Method), Electrophoresis of Hb & protein. Digital X-ray, OPG, Mammography, 4D USG, Echo, Color Doppler, ETT, ECG, CT Scan, 1.5T & 18 channel MRI and all other pathological and radiological test with reasonable price.\r\nIn addition we provide here general Health Checkup, Executive Health Check Up, Cardiac health Check up, Diabetic Health Check Up service. A complete Diabetic Centre Serving Diabetic patient’s continuously.\"', NULL, '2022-04-11 10:16:36', '2022-04-11 10:16:36'),
(18, 'Ibn Sina Hospital & Diagnostic Center, Jashore', '0421-60070', 'Jessore.dlab@ibnsinatrust.com', 'House: 68, Jail Road, Daratana, Ghop, Jashore (11 Storied Building);Beside of 250 Bed General Hospital, Main Road, Doratana, Jashore', '2109651649672279.png', '\"Now Ibn Sina at near Daratana Jail Road Jessore We believe that- To serve humanity, is to serve the Almighty. The Ibn Sina is providing the quality treatment & health care service through 18 branches in Dhaka and outside of Dhaka. Ibn Sina now in south Bengal in Ibn Sina Hospital & Diagnostic Center, Jashore already been introduced from March 2016. It is Situated at House No # 68, Jail Road, Daratana, Ghop, Jessore, bangladesh.\r\nThe Ibn Sina Trust, a well-known name in the field of health care in Bangladesh. The Ibn Sina Trust is established on 30 June 1980 in order to ensure World class Hospital health service of the people of Bangladesh. Adhering to established sequences the Ibn Sina Trust has been able to achieve confidence and trust of the people of this country through acts of service and welfare of the afflicted humanity.\r\nA pioneer prevention in the health care sector, has been providing world class medical service at reasonable cost for the past 39 years. World-class modern technology, renowned expert professionals and skilled workers sincere service introduced Ibn Sina as particularly.\"', NULL, '2022-04-11 10:17:59', '2022-04-11 10:17:59'),
(19, 'National Institute Of Neurosciences & Hospital', '880-2-9102142', 'nins@hospi.dghs.gov.bd', 'Sher-e-Bangla Nagar, Agargoan, Dhaka-1207,Bangladesh', '2929991649673265.png', 'National Institute of Neurosciences & Hospital started its journey from September, 2012. This Institute was officially inaugurated by Honorable Prime Minister Sheikh Hasina. It is situated in the health hub of Sher-e-Bangla Nagar, Dhaka. This is the only Govt. run tertiary care neuroscience center in Bangladesh. Four fifty (450) bedded 10 storied hospital having department of Neurology, Neurosurgery, Pediatric Neurology, Pediatric Neurosurgery, Neurophysiology, Neurointervention, Neurorehabilitation,  Neuroradiology, Neuropathology, Transfusion Medicine, Critical Care Medicine & so others. Our Operation Theatre, Cath Lab, Laboratory Services, Neuroradiology, Neurophysiology, ICU & HDU are equipped with all modern & sophisticated technologies. We are having specialized out patient service & 24×7 emergency service. We also provide in patient service. Patients get all these services almost free of cost or with minimum charges as per govt. schedule. Everyday more than thousand patients get our specialized OPD service. We conduct Stroke, Headache, Epilepsy, Movement Disorder & Botox Clinic at our outpatient department. Our 100 bedded comprehensive stroke unit is running. Our academic wing is enriched with reputed faculties & conduct residency training & Post Graduate courses for MD/MS/FCPS students under the curriculum of BSMMU & BCPS. We conduct regular training for our physicians working at primary & secondary level to make them acquainted with different neurological disorders & develops the skill to manage these disorders as a part of National Health Service policy. Neurosciences Institute also inspires our physicians & scientist in different health related research activities & in organizing scientific seminar, symposium & workshops with participation of national & international faculties. We already conducted National Epilepsy & Stroke Survey. In collaboration with ICDDRB & other international research organizations our clinical trial on GBS is going on. We already achieved Best Performance Health Minister Award 2017 for our outstanding contribution in our national health service & we believe our institute will be a centre of excellence in near future.', NULL, '2022-04-11 10:34:25', '2022-04-11 10:34:25'),
(20, 'Shaheed Suhrawardy Medical College and Hospital', '02-8144048', 'admin@shsmc.gov.bd', 'Sher-e-Bangla Nagar, Dhaka-1207, Bangladesh.', '5659711649673589.jpg', '\"Shaheed Suhrawardy Medical College (ShSMC) is the 14th government medical college of Bangladesh which is established in 2006. It is situated in the north-western part of Dhaka beside the National Parliament House, having a unique architectural campus and excellent academic atmosphere. Shaheed Suhrawardy Medical College Hospital has a long heritage of discharging health care services and also has a proud history of patronizing many medical institutes to establish and flourish. We have a great commitment to provide top class medical education, excellent training and quality research through eminent and experienced teachers.\r\n\r\nShaheed Suhrawardy Hospital was established in 1963 during the period of East Pakistan as Ayub Hospital for outdoor services. It was equipped with Pathological and Radiological supports. In addition to outdoor facilities, this medical organization then extended its service to indoor with 5 beds and subsequently with 25 beds.\r\n\r\nAfter independence through the great liberation war against Pakistan in 1971, the hospital had been renamed as Shaheed Suhrawardy Hospital against the name of Hossain Shaheed Suhrawardy, the living son of democracy. This hospital has magnificent architectural beauty designed by famous architect Louis I Kahn who also designed the National Assembly Hall of Bangladesh, one of the best architectural buildings of the world. The hospital was then extended gradually in different forms as general hospital to extend services to this area as well to serve as central referral centre from whole Bangladesh especially the area of northern and western part of Bangladesh.\r\n\r\nFeeling the need for further extension of scope for undergraduate medical education, the government of Bangladesh decided on September 5, 2005 to establish this medical college within this campus along with up gradation of Shaheed Suhrawardy Hospital to a Medical College Hospital. Accordingly its academic activities were started on May 6, 2006 with 100 freshman students. The colleges building including hostels were rapidly established and were inaugurated on Janurary 17, 2012 by Sheikh Hasina, the Honourable Prime Minister of peoples’ Republic of Bangladesh. Alongside the campus, a nursing institute is under way to be established soon.\r\n\r\nTo complete the total medical education, this institute extended is spectrum by starting dentistry as BDS course in 2011. Since then every year around 50 students are getting admitted to this institute. Dentistry department has separate independent unit with its own class rooms, library, laboratories, hostel and facilities for its subspecialities.\"', NULL, '2022-04-11 10:39:49', '2022-04-11 10:39:49'),
(21, 'National Institute of Mental Health and Hospital', '258153975', 'nimhr@hospi.dghs.gov.bd', 'Sher-E-Bangla Nagar, Dhaka-1207.', '1444891649673784.png', '\"The National Institute of Mental Health (NIMH) is the lead state agency dedicated to the treatment of mental health problems along with mental health policy formation, research, and training of mental health professionals.\r\nBangladesh is a country in South Asia with a population exceeding 164 million people and to meet the healthcare needs of diverse populations NIMH was established at the present location in 2001. It was inaugurated by the Honorable Prime Minister of Bangladesh, Sheikh Hasina and before that, from 1981, it was functioning as the Institute of Mental Health & Research at different medical college hospitals in Dhaka City.\r\nThe state-of-the-art medical facility is located in the heart of the capital city Dhaka, at Sher-E-Bangla Nagar and employs over 300 personnel to deliver outpatient, inpatient and emergency medical services for child and adult mental disorders. As the largest teaching psychiatric hospital of the country, NIMH trains the next generation of leaders in psychiatry, psychology and medicine while maintains a focus on research activities and mental health policy formation. NIMH is part of the Directorate General of Health Services, one of the agencies of Bangladesh Government’s Ministry of the Health and Family Welfare.\"', NULL, '2022-04-11 10:43:04', '2022-04-11 10:43:04'),
(22, 'National Institute of Traumatology and Orthopaedic Rehabilitation (NITOR)', '02-55058938', 'nitor@hospi.dghs.gov.bd', 'Sher-E-Bangla Nagar,Dhaka-1207', '7377721649673980.jpg', '\"The history of Orthopaedic Service Programme in Bangladesh runs somewhat concurrently with the development\r\nof the Rehabilitation Institute and Hospital for the Disabled.\r\n\r\nWith the War of Liberation, the new nation of Bangladesh was left with a great number of war injured. Although a few of the Freedom Fighters from among the wounded were taken by foreign countries for treatment, the great bulk of the wounded including the civilians had to be taken care of by the new nation itself. The vast majority of these patients had orthopaedic problems, and at that time there was only one qualified Bangladesh Orthopaedist in the country and he left within a matter of months.\"', NULL, '2022-04-11 10:46:20', '2022-04-11 10:46:20'),
(23, 'National Institute of Cardiovascular Diseases', '02-9122560-74', 'info@nicvd.com.bd', 'Sher-e-Bangla Nagar,,Dhaka-1207, Bangladesh', '9647981649674423.jpg', 'National Institute of Cardiovascular Diseases (NICVD) is a State of the Art Institute for the treatment of cardiovascular diseases in Bangladesh. The institute was established in 1978 with the aim of establishing modern cardiovascular care services in the country and to develop trained manpower in this field for the need of the country.', NULL, '2022-04-11 10:53:43', '2022-04-11 10:53:43'),
(24, 'CARe Medical College & Hospital', '09677-223344', 'info@carehospitalbd.com', '1/5, Block-B, Mohammadpur Housing Estate, College Gate, Mirpur Road, Dhaka 1207', '3080361650433945.png', 'The vision of CARe Medical College is to edicate and mentor future genertions to be expert clinicials and researchers. We will strive to be the best edicational institute. We will be known as a student first orgnization and will anticipate, plan and act decisively and with integrity. We will be a responsive, contributing citizen of the community. We will attain our vision throuth establishing partnerships of diverse persons working effectively together.', NULL, '2022-04-20 05:52:25', '2022-04-20 05:52:25'),
(25, 'Samarita Hospital Ltd.', '48117618', 'samoritabd@gmail.com', '89/1, Panthapath, Dhaka-1215,Bangladesh', '2970131650434070.png', '\"Samorita Hospital Ltd. since its inception in 1984 one of the pioneer private Hospital at Dhaka and as a matter fact all over Bangladesh. The Hospital is situated at the heart of capital Dhaka in Panthapath. From day one till today it has not compromised on quality services and emerged as one of the best hospitals in public sector.\r\nAt Samorita, patient can have access to over 100 consultant doctors from 25 sub-specialities. Our dedicated team of health care professionals is committed to give each patient the best care. Keeping in mind the motto ‘we care by our acts’. Samorita Hospital is serving for the last 36 years, providing both outdoor and indoor diagnostic services.\r\nWe try to give the highest priority to the best possible medical care for our patient.\"', NULL, '2022-04-20 05:54:30', '2022-04-20 05:54:30'),
(26, 'BIHS Hospital', '8035501-6', 'info@bihsh.org.bd', '\"125/1 Darus Salam, Mirpur\r\nDhaka-1216\"', '9590561650434370.png', 'Bangladesh Diabetic Somity (BADAS) has gained international reputation for its diabetes health care model termed as Ibrahim Model. It has also emerged as a major general health care provider all over Bangladesh. BADAS is contributing, to a large extent, in both undergraduate and postgraduate manpower development in Bangladesh through formal and informal educational and training programs. Its widely known institute BIRDEM is now offering 14 Postgraduate Courses/Diplomas in basic to clinical disciplines and it has also become a leading research institute in biomedical sciences with recognition by WHO as the Regional Collaborating Centre on Research in the Prevention and Control of Diabetes.', NULL, '2022-04-20 05:59:30', '2022-04-20 05:59:30'),
(27, 'Square Hospitals Ltd.', '02-8144400', 'info@squarehospital.com', '18 Bir Uttam Qazi Nuruzzaman Sarak West, Panthapath, Dhaka 1205', '2430061650434868.png', 'Square Hospitals Limited is a tertiary care hospital and the leading contributor of private healthcare services in Bangladesh. This has been achieved only through consistent commitment to improve the lives of people through utmost service excellence since its inception on 16th December, 2006. Square Hospital is one of the ventures of Square Group which is the top business group of the country.', NULL, '2022-04-20 06:07:48', '2022-04-20 06:07:48'),
