(32, 'CKD & Urology Hospital', '01777-685821', 'ckd@gmail.com', 'Shyamoli Kidney Hospital Road No. 3, House No. 32 Shyamoli, Dhaka-1207', '8119051650435676.jpg', 'Centre for Kidney Diseases and Urology Hospital is a specialized hospital that deals with both Nephrology and Urology related disorders. It launched it’s journey in 2014. Besides treatment of Urology and Nephrology related disorders there is facilities for doing dialysis and renal transplantation for renal failure patients at reasonably cheap price. Chief Transplant Surgeon performs operation without any honorium 4 times in a week. Total expenditure a patient incurs for renal transplant in our hospital is 2, 10,000/- (Operation charge+ Medicine cost +KT ICU charge). It is not only reasonably cheap than any of the corporate hospitals in Bangladesh but also than that of the neighboring countries.', NULL, '2022-04-20 06:21:16', '2022-04-20 06:21:16'),
(33, 'Central Hospital Limited', '02-41060806', 'appointmentchl@gmail.com', 'House#2,Road #5,Dhanmondi, Dhaka-1205', '2623401650435859.jpg', 'A galaxy of optimist with committed vision put their thinking-caps on to enter into the mystery as to why patients, even with minor complaints, even with minor complaints, prefer assessment and treatment abroad. A through and searched discussion over the matter led them to conceive the idea of establishing an ideal Health Service Complex – that shall be – By HIS GRACE – singled out as a center of excellence in the service of the needy and suffering humanity. Thus CENTRAL HOSPITAL LIMITED came into existence.', NULL, '2022-04-20 06:24:19', '2022-04-20 06:24:19'),
(34, 'Ad-Din Women\'s Medical College Hospital', '09612-345666', 'info@ad-din.org', '2 Bara Maghbazar, Outer Circular Rd, Dhaka 1217', '1967761650438667.png', 'Ad-din, a private not-for-profit organization operates in Bangladesh since 1980. Ad-din aims to improve the health, educational, social and financial status of underprivileged people, particularly of women and children. Ad-din runs affordable cost but high quality medical academic establishments like medical colleges (Ad-din Women’s Medical College in Dhaka, Ad-din Sakina Medical College at Jessore), nursing institutes (Fatema Nursing Institute in Dhaka, Ad-din Nursing Institute at Jessore, Safina Nursing Institute at Kushtia), health technology institute (Ad-din Women’s Institute of Health Technology), general hospital services (Ad-din Medical College Hospital in Dhaka, Ad-din Medical College Hospital at Jessore, Ad-din Hospital at Kushtia, Basundhara Ad-din Medical College Hospital in Dhaka), manufacture pharmaceutical products (Ad-din Pharmaceuticals Limited at Jessore) and provides community based essential health and family planning services package in Barisal and Khulna division and Dhaka city of Bangladesh.', NULL, '2022-04-20 07:11:07', '2022-04-20 07:11:07'),
(35, 'City Hospital & Diagnostic Center', '02-8143312', 'info@cityhospitalbd.com', '1/8, Block-E, Lalmatia, Satmosjid Road, Mohammadpur, Dhaka - 1207', '515911650439207.png', 'City Hospital Limited Dhaka is the newest hospital one of the largest Bangladeshi health care provider. The hospital is a 150 beds and tertiary care facility, delivering international standard health care at an affordable price to the peoples of Bangladesh', NULL, '2022-04-20 07:20:07', '2022-04-20 07:20:07'),
(36, 'Bangladesh Medical College Hospital', '2-44812101-08', 'bmcoffic.09@gmail.com', 'House # 34/35, Road # 14/A (New), Dhanmondi R/A, Dhaka-1209', '7123261650439592.png', 'Bangladesh Medical College (BMC) is the first non-govt medical college in Bangladesh. It was established in 1986 by a group of dedicated people called the founder members who were imbued with the ideas of providing quality medical education, research and services to people of this country at reasonable cost. The College and the Hospital are run by Bangladesh Medical Studies and Research Institute (BMSRI) which is established in 1984 and is a non-political and non-profitable organization.', NULL, '2022-04-20 07:26:32', '2022-04-20 07:26:32'),
(37, 'Bangladesh Medical College Hospital', '2-44812101-08', 'bmcoffic.09@gmail.com', 'House # 34/35, Road # 14/A (New), Dhanmondi R/A, Dhaka-1209', '2557501650441172.png', 'Bangladesh Medical College (BMC) is the first non-govt medical college in Bangladesh. It was established in 1986 by a group of dedicated people called the founder members who were imbued with the ideas of providing quality medical education, research and services to people of this country at reasonable cost. The College and the Hospital are run by Bangladesh Medical Studies and Research Institute (BMSRI) which is established in 1984 and is a non-political and non-profitable organization.', NULL, '2022-04-20 07:52:52', '2022-04-20 07:52:52'),
(38, 'BIRDEM General Hospital 1', '02-41060501', 'birdembd@gmail.com', '122 Kazi Nazrul Islam Ave, Dhaka 1000', '9410941651053073.jpg', 'The Diabetic Association of Bangladesh (Bengali acronym Bangladesh Diabetic Somiti- BADAS) was established on 28 February 1956 in Dhaka at the initiative of the late National Professor Dr Muhammad Ibrahim (1911-1989) and a group of social workers, philanthropists, physicians and civil servants. The Association started an out-patient clinic in 1957 in a small semipermanent structure of about 380 sq ft at Segun Bagicha, Dhaka. Over the years, the clinic has turned into a diabetes care and research complex at Shahbag, Dhaka, which, after the demise of Prof Md Ibrahim in 1989 has been renamed as the Ibrahim Memorial Diabetes Centre.', NULL, '2022-04-27 09:51:13', '2022-04-27 09:51:13'),
(39, 'BIRDEM General Hospital 2 (Child and Mother)', '02-41060501', 'birdembd@gmail.com', '122 Kazi Nazrul Islam Ave, Dhaka 1000', '6518491651053137.jpg', 'The Diabetic Association of Bangladesh (Bengali acronym Bangladesh Diabetic Somiti- BADAS) was established on 28 February 1956 in Dhaka at the initiative of the late National Professor Dr Muhammad Ibrahim (1911-1989) and a group of social workers, philanthropists, physicians and civil servants. The Association started an out-patient clinic in 1957 in a small semipermanent structure of about 380 sq ft at Segun Bagicha, Dhaka. Over the years, the clinic has turned into a diabetes care and research complex at Shahbag, Dhaka, which, after the demise of Prof Md Ibrahim in 1989 has been renamed as the Ibrahim Memorial Diabetes Centre.', NULL, '2022-04-27 09:52:17', '2022-04-27 09:52:17'),
(40, 'BRB HOSPITALS LIMITED', '01709-635863', 'info@brbhospital.com', '77a/A, Panthapath, Dhaka 1205', '3650511651053281.png', 'BRB Hospitals is an international standard hospital with the facilities of 05 ‘Centers of Excellence’. The ‘Center of Excellences’ are Gastro Liver Center, Mother & Child Care Center, Brain & Spine Center, Nephrology & Urology Center, Bone & Joint Center and other most modern ancillary & specialized Services supported by Internal Medicine, Cardiology, Respiratory Medicine, Gastrointestinal & Hepatobiliary Surgery, Hepato-Biliary-Pancreatic-Surgery Medical Oncology, Endocrinology & Diabetology, General & Laparoscopic Surgery, Hematology/Transfusion Medicine, ENT Head & Neck Surgery, Plastic & Reconstructive Surgery, Physiotherapy & Rehabilitation, Dermatology, Physical Medicine and Lab Medicine.', NULL, '2022-04-27 09:54:41', '2022-04-27 09:54:41'),
(41, 'Delta Hospital Ltd.MIRPUR', '02-9022410', 'delta@delta-hospital.com', '26/2, Principal Abul Kashem Road, Mirpur-1, Dhaka-1216', '6183171651053637.jpg', 'Delta Hospital Limited (DHL) is the pioneer organization for general medical treatment and in cancer diagnosis, treatment, and management in the private sector in Bangladesh. It’s provides the full range of radiation therapy, diagnostic facility, chemotherapy and surgery with consultant, pathologist, surgeon, medical Oncologist, radiation oncologist & other physicians.', NULL, '2022-04-27 10:00:37', '2022-04-27 10:00:37'),
