(43, 'United Hospital Limited gulsan', '09666-710666', 'info@uhlbd.com', 'plot 15, Road 71, Gulshan,Dhaka 1212, Bangladesh', '2173301651053808.png', 'Opening its doors in August 2006 and situated beside the picturesque Gulshan Lake, this hospital is one of the largest private sector healthcare facilities in Bangladesh. United Hospital has the capacity to house over 500 patients and has 12 state of the art operation theatres to cater to the needs of varied patient base.With more than 30 clinical sub specialties, our centres of Excellence like Cardiac, Cancer, Renal, Surgical, Neuroscience, Mother & Child Health and Critical Care Centres are staffed by the most esteemed doctors in their respective fields.', NULL, '2022-04-27 10:03:28', '2022-04-27 10:03:28'),
