(48, 'Ibn Sina Hospital Sylhet Limited', '01711-405834', 'info@ibnsinahospitalsylhet.com', 'Subhanighat Point,Sylhet, Bangladesh', '4789631651988075.png', '\"Ibn Sina designed to serve mankind with uncompromised quality at a reduced cost. we provide world-class services using the latest and technologically advanced appliances assisted by expert hands, A number of leading specialized consultants to attend here regularly, Fully computerized Hormone and Immunology analyzers, Biochemistry and Hematology auto-analyzer, Serology auto analyzer, Histopathology, Cytology, Microbiology, Blood culture (Fan Method), All Kinds of Culture (Aerobically), Electrophoresis of Hb & protein, Video endoscope & Colonoscopy, Digital E.E.G, NCV-EMG, OPG, 4D USG, Color Doppler,  Echo, ETT, ECG, Digital X-ray, OPG, Dental Xray, 128 slice CT Scan, 1.5T & 18 channel double unit MRI 1st  time in Cumilla.\r\n\r\nIn addition, Ibn Sina Provide general Health Checkup, Executive Health Check- Up, Cardiac health Checkup, Diabetic Health Check-Up service. A complete Physiotherapy & Rehabilitation Centre Serving therapy & Consultation to Orthopedic, Neurological patients continuously. It also offers a well-equipped complete modern Dental Centre & Model Pharmacy.\"', NULL, '2022-05-08 05:34:35', '2022-05-08 05:34:35'),
(49, 'Farabi General Hospital', '01711-520909', 'farabihospitalbd@gmail.com', 'Road # 14 (New), House # 8/3, Dhanmondi R/A, Dhaka- 1205', '9569211651988490.jpg', 'Farabi General Hospital.\r\nCategory: General Hospital\r\nAddress: Road # 14 (New), House # 8/3. Dhanmondi R/A, Dhaka- 1209.\r\nPhone : 02-58156167,\r\n01776117704, 880 2 81222471, 9140442', NULL, '2022-05-08 05:41:30', '2022-05-08 05:41:30'),
(50, 'Bangladesh Trauma Specialized Hospital', '01783-389050', 'TSH@gmail.com', 'Shyamoli Main Road, Dhaka 1207', '4087841651988917.jpg', 'Trauma Center is the most modern Orthopedic and Trauma (Injury) hospital. We provide 24 hr service. We have a highly specialized team of Orthopedic Surgeon, Neurosurgeon, Cardiologist, Urologist, etc in our team of management. Trauma Center, a super specialty hospital of international standard manned by renowned Orthopedic Surgeons, Medicine Specialist, Cardiologist, Urologists, Brain & Spinal Surgeon, and other support staff garnered from home plays an important role in providing desired care and treatment to the orthopedic& other patients of the country.', NULL, '2022-05-08 05:48:37', '2022-05-08 05:48:37'),
(51, 'Dhaka Trauma Center And Specialised Orthopedic Hospital', '02-9133150', 'info@traumacenter.com.bd', '23/6, 3rd Floor, Rupayan Shelford, Mirpur Road, Dhaka 1207', '3266631651989121.png', 'Trauma Center is the most modern Orthopedic and Trauma (Injury) hospital. We provide 24 hr service. We have a highly specialized team of Orthopedic Surgeon, Neurosurgeon, Cardiologist, Urologist, etc in our team of management. Trauma Center, a super specialty hospital of international standard manned by renowned Orthopedic Surgeons, Medicine Specialist, Cardiologist, Urologist, Brain & Spinal Surgeon, and other support staff garnered from home plays an important role in providing desired care and treatment to the orthopedic& other patients of the country.', NULL, '2022-05-08 05:52:01', '2022-05-08 05:52:01'),
(52, 'Trauma Center & AO Orthopaedic Hospital (Pvt.) Ltd', '02-58150111', 'info@traumacenter.com.bd', '22/8/A Opposite Manosik Hospital, Mirpur Rd, Dhaka 1207', '6262321651989340.png', 'Trauma Center is the most modern Orthopedic and Trauma (Injury) hospital. We provide 24 hr service. We have a highly specialized team of Orthopedic Surgeon, Neurosurgeon, Cardiologist, Urologist, etc in our team of management. Trauma Center, a super specialty hospital of international standard manned by renowned Orthopedic Surgeon, Medicine Specialist, Cardiologist, Urologists, Brain & Spinal surgeons, and other support staff garnered from home plays an important role in providing desired care and treatment to the orthopedic& other patients of the country.', NULL, '2022-05-08 05:55:40', '2022-05-08 05:55:40'),
(53, 'Infertility Care and Research Center', '01715-213783', 'icrc@gmail.com', '\"5/13 Humayun Road,\r\nBlock “B” Mohammadpur,\r\nopposite to Shwrawardi Hospital\r\nadjacent to the north side of Mohammadpur Model School and College\"', '9099361651989508.jpg', 'Our cutting-edge services in a patient-friendly and relaxed atmosphere brought great success and made us special. Your satisfaction is our top priority. With minimum investigation, we treat our patients in the most appropriate way. We are proud of our family-like atmosphere and a strong commitment to patient education. Combining the latest technology and advanced knowledge with compassion and individualized care, we ensure that our family can help you become a parent.', NULL, '2022-05-08 05:58:28', '2022-05-08 05:58:28'),
(54, 'Ahmed Medical Center Limited', '01797-619959', 'amcl@gmail.com', '71/1, Satmasjid Road, Near Sankar Bus Stand, Dhaka 1205', '5207911651989833.png', 'One of the oldest private hospitals in the City was founded by professor Ahmed Ali, former professor of surgery, at Dhaka Medical College. Presently it is being run by professor Ahmed Saeed, who specialized in Cancer Surgery. This center is good for multi-disciplinary cancer care.', NULL, '2022-05-08 06:03:53', '2022-05-08 06:03:53'),
(55, 'Al Helal Specialized Hospital Dhaka', '02-41000272', 'ahshd@gmail.com', '150, Begum Rokeya Sarani, Mirpur-10, Dhaka', '5240751651990186.webp', 'Al Helal specialized hospital is one of the largest private-sector 250-bed prestigious tertiary Healthcare facilities hospital in Dhaka Mirpur 10. This hospital emphasized on critical care service. This hospital started its journey in 1998 with the state of the art medical equipment and technology backed by highly qualified and trained people. This hospital provides critical care facilities including ICU, CCU, ICCU, and Stroke Center. Alhelal hospital also provides 24-hour pharmacy service, health check-up packages, and packages for surgical operations.', NULL, '2022-05-08 06:09:46', '2022-05-08 06:09:46'),
(56, 'Bangladesh ENT Hospital', '09666-710710', 'bangladeshenthospital@gmail.com', '4/1-A Sobhanbag, Mirpur Road Navana Newbury place(3rd floor) Opposite to, Dhaka, 1207', '4718501651990490.jpg', '\"BENTH is the largest ENT and Head Neck Surgery Hospital in the Private sector in Bangladesh. It is situated at the heart of the City in a well-communicated area.\r\nIt is a 30-bed fully equipped modern, complete hospital dedicated to the treatment of Ear Nose Throat, and Head Neck diseases including cancer treatment in Bangladesh with One-stop service following International standards.\"', NULL, '2022-05-08 06:14:50', '2022-05-08 06:14:50'),
(57, 'Bangabandhu Sheikh Mujib Medical University Hospital', '02 9661065', 'BSMMU@gmail.com', 'Bangabandhu Sheikh Mujib Medical University (BSMMU) Shahbag, Dhaka-1000.', '7601321651990905.png', 'Bangabandhu Sheikh Mujib Medical University (BSMMU) is the premier Postgraduate Medical Institution of the country. It bears the heritage to Institute of Postgraduate Medical Research (IPGMR) which was established in December 1965. In the year 1998 the Government converted IPGMR into a Medical University for expanding the facilities for higher medical education and research in the country. It has an enviable reputation for providing high quality postgraduate education in different specialties. The university has strong link with other professional bodies at home and abroad. The university is expanding rapidly and at present, the university has many departments equipped with modern technology for service, teaching and research. Besides education, the university plays the vital role of promoting research activities in various discipline of medicine. Since its inception, the university has also been delivering general and specialized clinical service as a tertiary level healthcare center.', NULL, '2022-05-08 06:21:45', '2022-05-08 06:21:45'),
(58, 'DIPHAM Hospital', '02-8153301', 'diphamh@gmail.com', '5 Rd No. Dhanmondi 27, Dhaka 1205', '3513271651991398.jpg', 'Private Hospital / Clinic', NULL, '2022-05-08 06:29:58', '2022-05-08 06:29:58'),
(59, 'MH Samorita Hospital & Medical College', '1841777999', 'info@mhsamorita.edu.bd', '117 Love Rd, Tejgaon, Dhaka 1208, Bangladesh', '3611631651997396.gif', '\"Bangladesh is a densely populated country in the world with a population of about 160 million. Bangladesh has a unique health system starting from the ministry of Health & Family Welfare(MOH&FW) in the capital to health Assistants at the grass-root level. But due to a shortage of budget, the service coverage is not adequate and uniform throughout the country. Privatization of Health care services is very important for Bangladesh. With this feeling MH Samaritan Hospital & Medical College, Dhaka started its journey in 2010 with permission from the MOH&FW of the Government of the People’s Republic of Bangladesh & Universities of Dhaka. All praise is for Allah.\r\nMH samorita Medical College and Dental Unit have taken steps to fulfill this gap and aspiration of the students in the prevailing situation. There is also a 500 bedded teaching hospital attached to MH Samorita Medical College. This Hospital is a well-equipped hospital delivering both general and specialized services including ICU, Cath Lab, CT Scan, CCU,  NICU, HDU & Dialysis unit.\"', NULL, '2022-05-08 08:09:56', '2022-05-08 08:09:56'),
(60, 'Dhaka Community Medical College and Hospital', '01711-194576', 'dcht87@gmail.com', '190/1 Baro Moghbazar, Wireless Railgate Bara Moghbazar, Dhaka 1217', '5903361652014409.png', 'DCH is the pioneer organization in the field of Arsenic contamination in Bangladesh. It really deserves the sole credit for highlighting the serious health hazards caused by arsenic contamination in groundwater. Then through their continuous efforts, DCH established this issue as a public health problem in Bangladesh. A number of research programs are also taken with some famous universities (Harvard School of Public Health, Harvard University-USA, Arsenic Foundation USA INC, Jadavpur University-Kolkata, India, and South Australia University- Australia) to understand various health and environmental problems that may cause long term problems with chronic arsenic poisoning.', NULL, '2022-05-08 12:53:29', '2022-05-08 12:53:29'),
(61, 'Universal Medical College Hospital Ltd.', '09612-808080', 'hello@umchltd.com', '74G/75, Pea-cock Square, New Airport Road, Dhaka 1215', '4422501652014630.png', 'UMCH is located at 74/G, Peacock Square, New Airport Road, Mohakhali, Dhaka. It is situated in the heart of Dhaka with an easy access of transportation and has been showing its dedication and true interest in serving people to every means and resources. It was established in the year of 1996 and subsequently being acquired by the current owner in 2004 with an objective to provide best quality health care services. After, we materialized ourselves to be a multidisciplinary healthcare service providing tertiary level of care with the core value to make healthier health sector. UMCH has realigned itself as an innovative medical service provider through a completely revolutionary strategy with a long history of excellent care and innovation.UMCH takes its management team as its strength as it consists of highly qualified and experience business and medical professionals. With their continuous hardship, Universal Medical College & Hospital Ltd. has turned out to be one of the most rapidly growing multi-disciplinary super-specialty tertiary care hospitals in Bangladesh.', NULL, '2022-05-08 12:57:10', '2022-05-08 12:57:10'),
(62, 'Impulse Hospital', '01715-016727', 'support@impulsehospital.com', 'Behind Channel I office, 304/E Bir Uttam Mir Shawkat Sarak, Dhaka 1215', '6421561652014800.png', 'Impulse is the brainchild of a group of specialist doctors who wanted to contribute to a “One Stop Standard Quality Health Service Centre” in the health care system of our country. We are transparent and very much committed to our works with devoted souls. We have knowledge and expertise at their maximum. Our primary motto is to “Serve First”. We know that as we are providing excellent service, the outcome is its logical consequence. We are concerned about the mental agony of a family and friends when their dear one becomes ill and come to the hospital with their illness with a distressing mental condition. We are empathic and serve the ill and distressed soul with our maximum clinical competence and compassionate care. Our Multi-disciplinary Expert Health Care Service Provider Team is here to serve you in your time of health care need “Day-Night 24 hours” all through 365 days’ year under one umbrella.', NULL, '2022-05-08 13:00:00', '2022-05-08 13:00:00'),
(63, 'Euro-Bangla Heart Hospital', '01971-008009', 'ebhh@gmail.com', '5/7, Lalmatia Girls College Rd, Dhaka 1207', '2170421652016266.jpg', 'Category: Cardiac ( Heart - Cardiology ) Hospital\r\nSpecialty: Coronary, Peripheral and Renal Angioplasty, Mitral, Pulmonary Valvuloplasty, TPM (Temporary Pacemaker), PPI (Permanent Pacemaker Implantation)\r\nAddress: 5/7 Block - D, Lalmatia Dhaka - 1207, Bangladesh', NULL, '2022-05-08 13:24:26', '2022-05-08 13:24:26'),
(64, 'United Hospital Limited , CHITTAGONG', '01914 001210', 'info@uhlbd.com', '23/A, M M Ali Road, Golpahar Moor,Mehdibag, Chittagong.', '1608291652016386.png', 'Opening its doors in August 2006 and situated beside the picturesque Gulshan Lake, this hospital is one of the largest private sector healthcare facilities in Bangladesh. United Hospital has the capacity to house over 500 patients and has 12 state of the art operation theatres to cater to the needs of varied patient base.With more than 30 clinical sub specialties, our centres of Excellence like Cardiac, Cancer, Renal, Surgical, Neuroscience, Mother & Child Health and Critical Care Centres are staffed by the most esteemed doctors in their respective fields.', NULL, '2022-05-08 13:26:26', '2022-05-08 13:26:26'),
(65, 'Ibrahim Memorial Diabetes Center', '09666-155160', 'info@dab-bd.org', '122 Kazi Nazrul Islam Avenue,Shahbagh,Dhaka-1000', '2587361652619130.gif', 'The Diabetic Association of Bangladesh, in Bangla বাংলাদেশ ডায়াবেটিক সমিতি (বাডাস), Bangladesh Diabetic Somiti (BADAS), was established on 28 February 1956 in Dhaka at the initiative of the late National Professor Dr  Mohammad Ibrahim (1911-1989) and a group of social workers, philanthropists, physicians and civil servants. In 1957, the Association started an outpatient clinic in a small semi-permanent structure of about 380 sq. ft. at Segun Bagicha, Dhaka. Over the years, the clinic has turned into a diabetes care and research complex at Shahbag, Dhaka, which, after the demise of Prof (Dr) Md Ibrahim in 1989, has been renamed as the Ibrahim Memorial Diabetes Centre. In addition, BADAS has now about 114 health care facilities and more than 500 accredited Diabetes Centres all over the country.', NULL, '2022-05-15 12:52:10', '2022-05-15 12:52:10'),
(66, 'New Dhaka Modern Clinic', '02-57313359', 'newdhakamoderclinic@gmail.com', '4,D.C.Roy Road, Mitford Rd,Dhaka', '8212051652619577.png', 'NEW DHAKA Modern Clinic is a Multi-Speciality Clinics', NULL, '2022-05-15 12:59:37', '2022-05-15 12:59:37'),
(67, 'Khwaja Yunus Ali Medical College and Hospital', '01716-291681', 'info@kyamch.org', '\"Enayetpur, Chauhali,Sirajganj-6751\r\nBangladesh\"', '2674801652619879.png', 'Khwaja Yunus Ali Medical College & Hospital (KYAMCH) is situated on 127 acres of land has one of the largest campuses in southeast Asia, Khwaja Yunus Ali Medical College & Hospital (KYAMCH) started its journey on May 17, 2004. KYAMCH is registered under the Society Act of Bangladesh and managed by a Trustee Board. It is a non-commercial venture for the promoters and is mostly funded by the Trustee Members. All revenues generated are utilized for maintenance, development, education, and research.', NULL, '2022-05-15 13:04:39', '2022-05-15 13:04:39'),
(68, 'Thalassemia Blood Bank', '02-48316116', 'info@thals.org', '30 Chamelibag 1st Lane, Dhaka 1217', '719131652619968.png', 'Thalassemia is a hereditary blood disorder that causes severe anemia in children. These patients need 1-2 bags of blood every month to survive. Thalassemia is very common in Bangladesh. 7% of our population are thalassemia carriers and every year 7000 new babies are born with thalassemia in Bangladesh. This disease is can be easily prevented with proper knowledge and awareness.', NULL, '2022-05-15 13:06:08', '2022-05-15 13:06:08'),
(69, 'CARe Medical College', '09677-223344', 'info@caremedicalcollegebd.com', '2, 2/1-A, Iqbal Road, Dhaka 1207', '3861641652620051.png', 'CARe Medical College (CAReMC) (Bengali: কেয়ার মেডিকেল কলেজ) is a private medical school in Asad Gate, Mohammadpur, Dhaka,Bangladesh. CAReMC was established in 2014. The founder principal was late professor Dr. M Moazzam Hossain and the governing body chairman is Professor Dr. Parveen Fatima. The college grew out of CARe Specialized Hospital. The name CARe stands for Center for Assisted Reproduction. It is affiliated with University of Dhaka as a constituent college. The college is associated with CARe Specialized Hospital, a 250-bed hospital about 800 metres (2,600 ft) north, in College Gate. CARe Specialized Hospital was renamed as CARe Medical College Hospital.', NULL, '2022-05-15 13:07:31', '2022-05-15 13:07:31'),
(70, 'Marks Medical College', '09611-772233', 'info@marksmedicalcollege.edu.bd', '14 Mirpur Rd, Dhaka 1206', '9674881652620278.png', 'MARKS Medical College (MRMC) is considered as one of the best private medical colleges in Bangladesh. It was established in 2011 by Late Brig. General Prof. M. R, Khan an eminent ENT-Head & Neck Surgeon ofthe country and the founder member, whose vision for providing quality medical education, research and health care service to people of this country at reasonable cost.', NULL, '2022-05-15 13:11:18', '2022-05-15 13:11:18'),
(71, 'Farazy Dental Hospital & Research Center', '01934-999555', 'farazydentalhospital@gmail.com', 'House-10, Block-H, Avenue Road-8 Banasree, Rampura Dhaka,', '9791191652620341.png', 'Welcome to Farazy Dental Hospital and Research Center. This is the first \"Super Specialized\" Dental hospital in Bangladesh. You will find country wide well known top class dental specialist at Farazy Dental Hospital and Research Center. They are always ready to provide you the best dental treatment. We always concern about the value of your teeth and money.', NULL, '2022-05-15 13:12:21', '2022-05-15 13:12:21'),
(72, 'East West Medical College & Hospital', '01700-868218', 'info@ewmch.com', 'Aichi Nagar, JBCS Sarani P.O- Khayertek, Dhaka 1711', '2773851652620398.png', 'East-West Medical College & Hospital is a leading medical institute in Bangladesh. This institute is located at Aichi Nagar, JBCS Saroni, Khairtak, Turag, Dhaka, Bangladesh. It is situated at the bank of river Turag with natural flourishing surroundings and five kilometers away from Hazrat Shah Jalal International airport. The college is to provide on excellent broad based education with a focus on professional development for the students to equip them with knowledge, skills and attitude necessary not only to address the priority health problems of the community but also to acquire a firm basis for future training and studies. This institution is one of the organization of Aichi Medical group and it runs under Alim foundation.', NULL, '2022-05-15 13:13:18', '2022-05-15 13:13:18'),
(73, 'Makka Eye Hospital', '01825-242247', 'makkaeye@gmail.com', 'Hasan nagor,Dhaka', '6124581652620585.png', 'Makka  Eye Hospital was established in 2009 in Uttara , Dhaka. Due to its humanitarian standpoint and sincerity in combating blindness Makka is now one of the most beloved destination for eye patients in Bangladesh. The efficiency, hardworking, devoutness to the blindness control program are the some advantages that helped her to start other three eye hospitals in Bangladesh.', NULL, '2022-05-15 13:16:25', '2022-05-15 13:16:25'),
(74, 'Tairunnessa Memorial Medical College & Hospital', '01914-213134', 'tmmch@citechco.net', 'Konia (Targach), National University, Gazipur ar, gazipur', '4840861652620644.png', 'Tairunnessa Memorial Medical College is a private medical school in Bangladesh, established in 1995. It is an institution of the Tairunnessa Memorial Medical Centre. It was founded by Mohammad Shamsul Hoque, named after his mother, the late Tairunnessa, a social reformer', NULL, '2022-05-15 13:17:24', '2022-05-15 13:17:24'),
(75, 'Dogma Hospital Ltd.', '01921-088076', 'dogmapl@gmail.com', 'Cha-88/1 Bir Uttam Raﬁqul Islam Avenue, Uttar Badda, Dhaka-1212.', '8223271652620712.png', '\"Dogma Hospital Ltd. is a General Hospital established in 1998. It is located in a busy urban hub at North Badda in Dhaka. The hospital governed by a dynamic set of leadership.\r\nDogma Hospital Ltd. Hospital is registered under the Company Act 1994 of Bangladesh. The Hospital is administered and managed in accordance with upright healthcare practices. The current Scheme of Management was approved in 2016. The property is vested in Board of Directors.\"', NULL, '2022-05-15 13:18:32', '2022-05-15 13:18:32');
